  selector: 'app-search',
  templateUrl: './search.component.html',
  styleUrls: ['./search.component.css']
})
export class SearchComponent {

}
<div class="container border border-dark d-inline-flex p-2">
    <div class="row-xs input-group ">
        <input class="h-75 d-inline-block" type="text"/>
